"use strict"

import { StyleSheet, Text, View } from 'react-native';

const UploadScreen = () => {
    return (
        <View style={styles.container} >
            <Text>Upload</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        alignItems: 'center',
    }
})

export default UploadScreen;
